import React, { Component } from 'react';

class Titlesection extends Component {
	constructor(props) {
       this.props.className= 'jumbotron text-center';
       this.props.innerHTML= 'Download Video and Audio from YouTube';
       super(props);
    }

	render() {
		const title = <div className={this.props.className}>
		  <h1 innerHTML={this.props.innerHTML}></h1>
		</div>;

		return title;
	}
}

export default Titlesection;
